import logo from './logo.svg';
import './App.css';
import EventsParent from './components/eventsParent';
import ClubParent from './components/clubParent';
import ClubSlider from './components/clubSlider';
import Contact from './components/contact';
import Welcome from './components/welcome';
import Footer from './components/footer';
import Aos from 'aos';
import 'aos/dist/aos.css';

import TheCalendar from './components/theCalendar';
window.addEventListener('scroll', function(){
  let offset = window.pageYOffset;
  document.getElementById('firstparallax').style.backgroundPositionY = offset*0. + "px";
  document.getElementById('layer').style.backgroundPositionY = offset*0.7 + "px";
//   document.getElementById('layer2').style.backgroundPositionY = offset*0.7 + "px";
})

class App extends Component {
  state = {  }
  render() { 
    return (  


      <div   >


      <Welcome/>

     <section id="events">    <EventsParent/> </section>
   <div 
   className='j2'>
   <section id="clubs">     <ClubSlider /> </section> 



      </div> 
      <div  id='layer'  className='jumbotron calendar' >
   <TheCalendar/>
   </div>
      <Footer/>
      </div>


     );
  }
}

export default App;
